import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const Service=()=>{
    return(
        <React.Fragment>
            {
            Sdata.map((val,ind)=>{
                return(
                    <Card imgsrc={val.imgsrc} title={val.title}/>
                    );
            })
        }
        </React.Fragment>
    );
}
export default Service;
